import React from 'react';
//import Diapo from '../../data/diapo.js';
const {image} = require('../../data/diapo.json');

const baseUrl = './../media/icon/';

const Main = (props) => {

  return (
    <main className="container row">
      <div className="">
        {
          image.map((img,k) => {
            return <img key={k}
              alt={img.alt}
              className={img.selecteur}
              src={require(baseUrl+img.name)} />
           })
        }
    </div>
  </main>
)
}

export default Main;
